package com.type;


public class List_Data {
	private String time;
	private String days;
	
	public List_Data(String time, String days) {
		// TODO Auto-generated constructor stub
		this.time = time;
		this.days = days;
	}
	
	public String getTime() {
		return time;
	}
	public void setTime(String time) {
		this.time = time;
	}
	public String getDays() {
		return days;
	}
	public void setDays(String days) {
		this.days = days;
	}
}